import React from "react";

const Paginado = ({paginado , pokexPagina , pokemons}) => {

    let arrayPoke = [];

    for (let i = 1; i<= Math.ceil(pokemons/pokexPagina); i++){
        arrayPoke.push(i)
    }

    return (
        <ul>
            hola
            {
                arrayPoke && arrayPoke.map(num =>{
                    <li onClick={paginado}>
                        <a> {num} </a>
                    </li>
                })
            }
        </ul>
    )
}

export default Paginado
